var HELP = "\n<div>\n\n  <h1>Welcome to Jerur: Your Church Community Platform!</h1>\n  <p>We're excited to have you as a member of our platform. This guide will assist you in getting started with Jerur's SaaS services, enabling you to make the most of its robust features.</p>\n  \n  <div class=\"section\">\n    <h2>Exploring the Platform</h2>\n    <p>As a Jerur member, you're equipped with an array of powerful tools:</p>\n    <ul>\n      <li><strong>Create & Manage Events:</strong> Plan and promote church events. Visit the \"Events\" section to add new events, edit details, and manage RSVPs.</li>\n      <li><strong>Launch Campaigns:</strong> Champion church initiatives. In the \"Campaigns\" area, you can set up, edit, and monitor progress for various campaigns.</li>\n      <li><strong>Donations & Giving:</strong> Seamlessly contribute to your church community. Use the \"Donations\" section to give tithes, offerings, and other donations securely.</li>\n      <li><strong>Set Up Your Church Profile:</strong> Showcase your congregation. Visit your church profile settings to update details, upload images, and engage your members.</li>\n      <li><strong>Stripe Connect Integration:</strong> Enable easy donations. In your profile settings, set up your Stripe Connect account to facilitate secure online transactions.</li>\n    </ul>\n  </div>\n  \n  <div class=\"section\">\n    <h2>Creating Events</h2>\n    <p>To create an event, follow these steps:</p>\n    <ol>      \n      <li>Navigate to the \"Events\" section.</li>\n      <li>Click \"Add New Event.\"</li>\n      <li>Fill in event details, including title, date, location, and description.</li>\n      <li>Upload event images to make it visually appealing.</li>\n      <li>Save the event.</li>\n    </ol>\n  </div>\n  \n  <div class=\"section\">\n    <h2>Managing Campaigns</h2>\n    <p>To start or manage a campaign:</p>\n    <ol>     \n      <li>Go to the \"Campaigns\" section.</li>\n      <li>Click \"Create Campaign\" to set up a new campaign.</li>\n      <li>Define the campaign goal, description, and target amount.</li>\n      <li>Choose images to make your campaign stand out.</li>\n      <li>Save the campaign and monitor progress.</li>\n    </ol>\n  </div>\n  \n  <div class=\"section\">\n    <h2>Making Donations and Giving</h2>\n    <p>Contributing to your church community is simple:</p>\n    <ol>\n      <li>Login to your account.</li>\n      <li>Visit the \"Donations\" section.</li>\n      <li>Choose the donation type.</li>\n      <li>Enter the donation amount.</li>\n      <li>Fill the rest of the form details.</li>\n      <li>Save the donation.</li>\n    </ol>\n  </div>\n  \n  <div class=\"section\">\n    <h2>Setting Up Your Church Profile</h2>\n    <p>Make your church's presence shine:</p>\n    <ol>     \n      <li>Navigate to the \"Church Profile\" settings.</li>\n      <li>Upload your church logo and relevant images.</li>\n      <li>Fill in church details, such as location, description, and contact information.</li>\n      <li>Save the changes to complete your profile setup.</li>\n    </ol>\n  </div>\n  \n  <div class=\"section\">\n    <h2>Stripe Connect Integration</h2>\n    <p>Enabling secure online transactions:</p>\n    <ol>    \n      <li>Access your profile settings.</li>\n      <li>Click on \"Stripe Connect\" settings.</li>\n      <li>Follow the steps to link your Stripe account for seamless donation processing.</li>\n    </ol>\n  </div>\n  \n  <p>If you ever need assistance or have questions, don't hesitate to reach out to our support team. We're dedicated to ensuring your experience with Jerur SaaS Church Platform is rewarding and smooth.</p>\n  </div>\n\n";
